	public void runTest() {
	    System.out.println("=== 클라이언트 자동 수신 테스트 시작 ===");
	    
	    TCPManager tcp = TCPManager.getInstance();
	    tcp.connect(this); // 1. 서버에 연결

	    if (tcp.isConnected()) {
	        System.out.println("TCP 연결 성공! 로그인 메시지를 보냅니다.");
	        
	        // 2. 로그인 요청 메시지 전송
	        tcp.sendMessage("%Login%&id$testuser1&password$123%");
	        
	        System.out.println("\n서버로부터 오는 메시지를 자동으로 수신합니다...");
	        System.out.println("서버와의 연결이 끊기거나 프로그램을 종료하면 테스트가 중단됩니다.\n");

	        // 3. 프로그램이 바로 종료되지 않도록 연결이 유지되는 동안 대기하는 루프
	        try {
	            while (tcp.isConnected()) {
	                // 메인 스레드는 1초마다 잠시 멈추며 대기합니다.
	                // 이 시간 동안 TCPReceiver 스레드가 백그라운드에서 메시지를 수신합니다.
	                Thread.sleep(1000); 
	            }
	        } catch (InterruptedException e) {
	            // 스레드 대기 중 오류 발생 시
	            e.printStackTrace();
	            Thread.currentThread().interrupt(); // 스레드 인터럽트 상태 복원
	        }

	    } else {
	        System.out.println("TCP 연결 실패!");
	    }

	    // 4. 서버와의 연결이 끊겨 루프가 종료되면 자동으로 연결 해제
	    tcp.disconnect();
	    System.out.println("=== 클라이언트 테스트 종료 ===");
	}
